import React, { Component } from 'react';

export class Create extends Component {
    constructor(props){
        super(props);
        this.state = {
            who: '',
            what: '',
            where: '',
            when: '',
        }
    }
    render(){
        return (
            <div>
                <form onSubmit={this.onSubmit}>
                    <div>
                        <label>Wh</label>
                        <input type="text"/>
                    </div>
                </form>
            </div>
        )
    }
}

export default Create;
